#include <iostream>
#include <limits>
#include <vector>
#include <unordered_set>
#include <cmath>

using namespace std;
/*
 * https://leetcode-cn.com/problems/longest-duplicate-substring/ 
 * 二分法检测len（对for (len=1~size-1)的优化），
 * Rabin-Karp 字符串编码，缩短两个字符串匹配的速度
 * 生日悖论（%MAX_INT）解决溢出
 * */

typedef long long LL;
#define c2i(c) (c-'a')

class Solution {
    // LL MAX_INT = LL(pow(2, 32));
    LL MAX_INT = std::numeric_limits<LL>::max();;
    // LL MAX_INT = 1e9+7; 
public:
    string longestDupSubstring(string s) {
        if ( s.size() < 2 )
        {
            return "";
        }

        int minLen = 1;
        int maxLen = s.size() - 1;
        while ( minLen <= maxLen )
        {
            int len = ( minLen + maxLen ) / 2;
            int ansIdx = binarySearch( s, len );
            if ( ansIdx >= 0 )
            {
                binarySearch( s, len );
                minLen = len + 1;
            } else
            {
                maxLen = len - 1;
            }
        }
        
        int ansIdxMin = binarySearch( s, minLen - 1 );
        if ( ansIdxMin >= 0 )
        {
            return s.substr( ansIdxMin, minLen - 1 );
        }

        return "";
    }

    int binarySearch( const string &s, const int len )
    {
        int ansIdx = -1;
        unordered_set<LL> dupV;
        dupV.reserve( s.size() );

        dupV.clear();
        LL preL = getSubStrLong( s, 0, len );
        dupV.insert( preL );
        LL constL = getConstLenLong( len );
        for ( int j  = 1; j < s.size() - len + 1; j++ )
        {
            LL B = ( preL*26 % MAX_INT - c2i(s[j-1]) * constL % MAX_INT + c2i(s[j+len-1])) % MAX_INT;
            if ( dupV.count( B ) )
            {
                ansIdx = j;
                break; // 找出一个即可
            } 
            dupV.insert( B );
            preL = B;
        }

        return ansIdx;
    }

    LL getSubStrLong( const string &s,
                      int          idx,
                      int          len )
    {
        LL ans = 0;
        for ( int i = 0; i < len; i++ )
        {
            ans = ( ans*26 % MAX_INT + c2i(s[i+idx]) ) % MAX_INT;
        }
        return ans;
    }

    // 26^len
    LL getConstLenLong( int len )
    {
        LL ans = 1;
        for ( int i = 0; i < len; i++ )
        {
            ans = ans*26 % MAX_INT;
        }
        return ans;
    }

    LL getNextLong( LL         preL,
                    LL         constL,
                    char       delChar,
                    char       addChar )
    {
        LL ans = ( preL*26 % MAX_INT - c2i(delChar) * constL % MAX_INT + c2i(addChar) ) % MAX_INT;
        return ans;
        /*
        LL ans = ( preL*26 - c2i(delChar) * constL % MAX_INT + MAX_INT ) % MAX_INT;
        ans = (ans + c2i(addChar) ) % MAX_INT;
        */
        return ans;
    }
};

